const getMergedProducts = (filterFn) => {
  return Object.entries(products_seba)
    .filter(([key, value]) => (filterFn ? filterFn(key, value) : true))
    .reduce((acc, [, value]) => acc.concat(value), []);
};

export const allProducts_seba = getMergedProducts();